import React from 'react';
import {Link, Switch, Route} from 'react-router-dom';
import Home from './components/Home';
import './index.css';
import Services from './components/Services';
import Contact from './components/Contact';
import Blog from './components/Blog';
import Team from './components/Team';
import CM from './components/CM';
import Physicians from './components/Physicians';
import logoPic from './images/EH logo.jpg';

function App(props) {
  return (
    <div>
      <nav className="appNav">
      <img>{logoPic}</img>
        <ul>

          <Link><li>Home</li></Link>
          <Link><li>Services & Treatments</li></Link>
          <Link><li>Meet Our Team</li></Link>
          <Link><li>Case Managers</li></Link>
          <Link><li>Referring Physicians</li></Link>
          <Link><li>Blog</li></Link>
          <Link><li>Contact</li></Link>

        </ul>
      </nav>

      <Switch>
        <Route exact path='/' render={() => <Home/>} />
        <Route exact path='/Services' render={() => <Services/>} />
        <Route exact path='/MeetOurTeam' render={() => <Team/>} />
        <Route exact path='/CaseManagers' render={() => <CM/>} />
        <Route exact path='/Physicians' render={() => <Physicians/>} />
        <Route exact path='/Blog' render={() => <Blog/>} />
        <Route exact path='/ContactUs' render={() => <Contact/>} />
      </Switch>

    </div>
  );
}

export default App;
